import React from "react";
import style from "../styles/navbar.module.css";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className={style.container}>
        <h1 onClick={() => {
            window.location.replace("/#home")
        }}>Home</h1>
      <h1 onClick={() => {
            window.location.replace("/#home")
        }}>About</h1>
      <h1 onClick={() => {
            window.location.replace("/#home")
        }}>Skills</h1>
      <h1 onClick={() => {
            window.location.replace("/#home")
        }}>Projects</h1>
      <h1 onClick={() => {
            window.location.replace("/#home")
        }}>Contact</h1>
    </div>
  );
};

export default Navbar;
